package businessLayer;

import java.util.ArrayList;

import dao.GameDAO;
import dao.OwnedGameDAO;
import dao.PageCommentDAO;
import dao.UserDAO;
import dataAccess.GameAccess;
import dataAccess.UserAccess;
import dataAccess.UserLibraryAccess;
import exceptions.NoGame;
import exceptions.NoResult;
import exceptions.NoUser;
import exceptions.NotFound;

public final class ProfileManager
{
	
	public static String getProfileString(String aUser)
	{
		String lProfile = new String();
		UserAccess lDB = new UserAccess();
		UserDAO lUser = null;
		try {
			lUser =	lDB.fetchUser(aUser);
		} catch (NoResult e) {
			return " ";
		}
		
		lProfile += lUser.getFirstname() + " " + lUser.getSurname() + "\n";
		lProfile += "Games owned: \n";
		
		for(OwnedGameDAO j: lUser.getGamesOwned())
		{
			lProfile += j.getGame().getGameName() + " Status: " +j.getStatus() + "\n";
		}
		
		lProfile += "Comments:";
		int i = 0;
		
		for(PageCommentDAO j: lUser.getCommentsMadeTo())
		{
			//Only show latest 15 comments
			if(i == 15)
			{
				break;
			}
			lProfile += "\n" + j.toString();
			i++;
		}
		
		return lProfile;
	}
	
	/**
	 * Changes the password to the passed in password. It also requires the username 
	 * to find the user object.
	 * @param aUser
	 * @param aPass
	 */
	public static void changePassword(String aUser, String aPass)
	{
		UserAccess lDB = new UserAccess();
		try
		{
			UserDAO userToChange = lDB.fetchUser(aUser);
			userToChange.setPassword(aPass);
			
		}
		catch(NoResult e)
		{
			return;
		}		
	}
	
	public static void addGameToUser(GameDAO aGame, String aUser) throws NoUser
	{
		UserLibraryAccess lLibraryDB = new UserLibraryAccess();
		UserAccess lUserDB = new UserAccess();
		try {
			lLibraryDB.addGame(aGame, lUserDB.fetchUser(aUser));
		} catch (NoResult e) {
			throw new NoUser("Unable to find " + aUser);
		}
	}
		
	public static void addGameToUser(String aGameName, String aDev, String aPlat, String aUser) throws NotFound
	{
		UserAccess lUserDB = new UserAccess();
		GameAccess lGameDB = new GameAccess();
		UserLibraryAccess lLibraryDB = new UserLibraryAccess();
		UserDAO lUser = null;
		GameDAO lGame = null;
		
		try {
			lGame = lGameDB.fetchGame(aGameName, aDev, aPlat);
		} catch (NoResult e) {
			throw new NoGame(aGameName);
		}
		try 
		{
			lUser = lUserDB.fetchUser(aUser);
		} catch (NoResult e)
		{
			throw new NoUser(aUser);
		}
		lLibraryDB.addGame(lGame, lUser);
	}
	
	public static boolean usernameInUse(String aUsername)
	{
		try{
			UserAccess lUserDb = new UserAccess();
			lUserDb.fetchUser(aUsername); // if there is already a user, we'll get the NoResult exception
			return true; // no exception thrown, username is in use
		}
		catch(NoResult e){
			return false; // exception thrown, username not in use
		}
	}
	
	public static void addNewUser(String username, String password, String firstname, String surname, String email)
	{
		UserAccess lUserDB = new UserAccess();
		UserDAO lUser = new UserDAO();
		
		lUser.setUsername(username);
		lUser.setPassword(password);
		lUser.setFirstname(firstname);
		lUser.setSurname(surname);
		lUser.setEmail(email);
		lUser.setAdmin(0); // not admin - use add admin function for that (which can only be used by existing admins)
		
		lUserDB.commitUser(lUser);
	}
}

