package dataAccess;

import org.hibernate.Query;
import org.hibernate.Session;
import org.hibernate.Transaction;

import dao.UserDAO;


import exceptions.NoResult;

public class UserAccess extends DBLayer
{

	public UserAccess()
	{
		super();
	}
	
	/**
	 * Returns a userDAO for the passed in username this opens a new session
	 * Tested: 12/09/2011
	 * @param aUsername
	 * @return
	 * @throws NoResult 
	 */
	public UserDAO fetchUser(String aUsername) throws NoResult
	{
		UserDAO lResult = null;
		openSession();
		Query lQuery = fSession.createQuery("FROM UserDAO WHERE Username='" + aUsername + "'");
		lResult = (UserDAO)lQuery.uniqueResult();
		if(lResult ==  null)
		{
			throw new NoResult("The user" + aUsername + " doesn't exist");
		}
		closeSession();
		return lResult;
	}
	
	/**
	 * Commits a user to the database, when committing a user it must be the same 
	 * object reference which was returned from fetchUser, otherwise it won't commit 
	 * properly. This method also closes the current session
	 * Charlotte - removed "fTransaction = fSession.beginTransaction()" from fetchUser and put it here instead - don't need a transaction
	 * to fetch a user, but you do need one to commit - now commitUser can be used in more scenarios (like when creating a new user)
	 * @param aUser
	 */
	public void commitUser(UserDAO aUser)
	{
		openSession();
		fTransaction = fSession.beginTransaction();
		fSession.save(aUser);
		fTransaction.commit();
		closeSession();
	}
}

----------------------------------- SOURCE END -------------------------------------
